    false,nt"url": null,nt"notes": "The U.S. Geological Survey, in cooperation
    with the North Platte Natural Resources District, used two surface geophysical techniques,
    capacitively coupled and direct-current continuous resistivity profiling, to map
    near-surface lithologies beneath the Interstate and Tri-State Canals in the spring
    and summer of 2004. This coverage represents the average electrical resistivity
    of sediments within the upper 8 meters below selected parts of the Tri-State Canal
    within Scotts Bluff County in western Nebraska.",nt"license_title": null,nt"extras":
